import React, { useState, useEffect } from 'react';
import { Moon, Sun, Plus, Check, Circle, Menu, X, Inbox, Calendar, Folder, CheckSquare, Trash2, Star, Home } from 'lucide-react';
import './App.css';

function App() {
  const [isDarkMode, setIsDarkMode] = useState(false);

  // Mock todo data to showcase the beautiful design
  const [todos] = useState([
    { id: 1, text: 'Design the perfect todo app', completed: true },
    { id: 2, text: 'Create beautiful animations', completed: false },
    { id: 3, text: 'Add dark mode support', completed: true },
    { id: 4, text: 'Polish the user experience', completed: false },
    { id: 5, text: 'Ship to production', completed: false },
  ]);

  // Load theme preference from localStorage
  useEffect(() => {
    const savedTheme = localStorage.getItem('theme');
    if (savedTheme) {
      setIsDarkMode(savedTheme === 'dark');
    } else {
      // Default to system preference
      setIsDarkMode(window.matchMedia('(prefers-color-scheme: dark)').matches);
    }
  }, []);

  // Apply theme to document
  useEffect(() => {
    document.documentElement.setAttribute('data-theme', isDarkMode ? 'dark' : 'light');
    localStorage.setItem('theme', isDarkMode ? 'dark' : 'light');
  }, [isDarkMode]);

  const toggleTheme = () => {
    setIsDarkMode(!isDarkMode);
  };

  const completedCount = todos.filter(todo => todo.completed).length;
  const totalCount = todos.length;

  return (
    <div className="app">
      <div className="container">
        {/* Header */}
        <header className="header">
          <div className="header-content">
            <div className="logo-section">
              <div className="logo">
                <div className="logo-icon">✓</div>
              </div>
              <div className="title-section">
                <h1>Focus</h1>
                <p className="subtitle">Stay organized, stay productive</p>
              </div>
            </div>
            <button 
              className="theme-toggle"
              onClick={toggleTheme}
              aria-label="Toggle theme"
            >
              {isDarkMode ? <Sun size={20} /> : <Moon size={20} />}
            </button>
          </div>

          {/* Progress indicator */}
          <div className="progress-section">
            <div className="progress-info">
              <span className="progress-text">
                {completedCount} of {totalCount} completed
              </span>
              <div className="progress-percentage">
                {Math.round((completedCount / totalCount) * 100)}%
              </div>
            </div>
            <div className="progress-bar">
              <div 
                className="progress-fill"
                style={{ width: `${(completedCount / totalCount) * 100}%` }}
              />
            </div>
          </div>
        </header>

        {/* Add new todo */}
        <div className="add-todo">
          <div className="add-todo-container">
            <Plus size={20} className="add-icon" />
            <input 
              type="text" 
              placeholder="Add a new task..."
              className="add-input"
            />
            <button className="add-button">Add</button>
          </div>
        </div>

        {/* Todo list */}
        <div className="todo-list">
          {todos.map((todo) => (
            <div 
              key={todo.id} 
              className={`todo-item ${todo.completed ? 'completed' : ''}`}
            >
              <button className="todo-checkbox">
                {todo.completed ? (
                  <Check size={16} className="check-icon" />
                ) : (
                  <Circle size={16} className="circle-icon" />
                )}
              </button>
              <span className="todo-text">{todo.text}</span>
              <div className="todo-actions">
                <button className="todo-action edit">Edit</button>
                <button className="todo-action delete">Delete</button>
              </div>
            </div>
          ))}
        </div>

        {/* Stats footer */}
        <footer className="stats">
          <div className="stats-item">
            <span className="stats-number">{totalCount}</span>
            <span className="stats-label">Total tasks</span>
          </div>
          <div className="stats-item">
            <span className="stats-number">{completedCount}</span>
            <span className="stats-label">Completed</span>
          </div>
          <div className="stats-item">
            <span className="stats-number">{totalCount - completedCount}</span>
            <span className="stats-label">Remaining</span>
          </div>
        </footer>
      </div>
    </div>
  );
}

export default App;
